import { Injectable } from '@angular/core';
import { Router, ActivatedRoute } from '@angular/router';
import { AppService } from '../../app.service';
import { SoftKioskService } from '../../softkiosk.service';

@Injectable({
    providedIn: 'root'
})

export class MoovhopService {

    timeout: any = null;
    identityPicture: boolean = false;
    route: any = '/createAccountPersonalInformations';

    currentView = "";

    isScanFinished: boolean = false;
    scanVisited: number = 0;

    LineChoosed: number = 1;

    ActionChoosed: number = 1;

    newerCiImageCapture: string = "";

    QRCodeScaned: boolean = false;


    whatSubscription: string = "";
    paidWithCB: boolean = false;
    priceSubscription: number = 0;


    textSubscription: string = '<p style="text-align:center;">';

    heureCB: string = "";

    textCB: string = '';


    private moovHopRouterDic: any = {
        // use case achat d'un pass (cr√©ation d'un compte)
        '/homepage': '/createAccountMenu',
        '/createAccountMenu': '/createAccountCamera',
        '/createAccountCamera': 'createAccountScanFinish',
        '/createAccountScanFinish': '/createAccountPersonalInformations',
        '/createAccountPersonalInformations': '/createAccountHello',
        '/createAccountHello': '/createAccountProofAddress',
        '/createAccountProofAddress': '/createAccountSubscriptionChoice',
        '/createAccountSubscriptionChoice': '/createAccountQRCodeYesNo',
        '/createAccountQRCodeYesNo': '/createAccountQRCodeScan',
        '/createAccountQRCodeScan': '/paymentChoice',
        '/paymentChoice': '/paymentCB',
        '/paymentCB': '/subscriptionConfirmation',
        '/subscriptionConfirmation': '/homepage',

        // use case impression d'une fiche horaire
        '/printingMenu': '/printingInformationChoice',
        '/printingInformationChoice': '/printingMethodsGettingTimetable',
        '/printingMethodsGettingTimetable': '/printingScanQRcode',
        '/printingScanQRcode': '/homepage',


        // use cas paiement d'une amende
        '/identificationMenu': '/scanQrCode',
        '/scanQrCode': '/identificationValidation',
        '/identificationValidation': '/infromationSummary',
        '/infromationSummary': '/paymentChoice',
        '/thanksPaymentReport': '/homepage',


    };


    private moovHopPreviousRouterDict: any = {

    };

    private fcMoovHopRouterDict: any = {

    }
    previewImageScanId: string = "./assets/MOOVHOP-EK4000-2023-RNTP/loadingPreview.png";
    previewImageProfile: string = "./assets/MOOVHOP-EK4000-2023-RNTP/loadingPreview.png";


    constructor(private router: Router, private appService: AppService, private _router: ActivatedRoute) {
        //navigation
        let _this = this;
        this.currentView = appService.getCurrentView();
        window.addEventListener("moovHopNav", function (e: any) {
            _this.navigateAfterDelay(e.detail.delay, e.detail.goTo)
        })
    }

    preloadImages() {
        let images = [
            "./assets/MOOVHOP-EK4000-2023-RNTP/cite1.png",
            "./assets/MOOVHOP-EK4000-2023-RNTP/cite2.png",
            "./assets/MOOVHOP-EK4000-2023-RNTP/cite3.png",
            "./assets/MOOVHOP-EK4000-2023-RNTP/cite4.png",
        ];
        for (let i = 0; i < images.length; i++) {
            let img = new Image();
            img.src = images[i];
        }
    }

    timeoutNavigation() {
        this.timeout = setTimeout(() => {
            if(this.router.url !== '/homepage'){
                this.navigateAfterDelay(0, "/homepage");
            }
        }, 120000);
    }

    resetTimeoutNavigation() {
        clearTimeout(this.timeout);
    }


    navigateAfterDelay(delay: number, goTo: string = "") {
        let router = this.router;
        let newRoute = (goTo) ? goTo : (this.moovHopRouterDic[router.url]) ? this.moovHopRouterDic[router.url] : "";
        setTimeout(() => {
            if (newRoute) {
                router.navigate([newRoute]);
            }
        }, delay)
    }

    get currentUrl() {
        return this.router.url;
    };

    get nextRoute() {
        return this.moovHopRouterDic[this.router.url];
    };

    get previousRoute() {
        return this.moovHopPreviousRouterDict[this.router.url];
    };

    
    htmlReceiptContent: string = '';

    line1: string = '';
 
    

    line2: string = '';

    line3: string='';





    line4:string = ''

}